This function calculates the nth Fibonacci number using an iterative approach. The Fibonacci sequence is defined as follows: `fib(0) = 0`, `fib(1) = 1`, and for `n > 1`, `fib(n) = fib(n-1) + fib(n-2)`.

The function starts by checking if `n` is 0 or 1, returning the corresponding value directly. For other values of `n`, it initializes two variables `a` and `b` to represent the first two Fibonacci numbers (0 and 1, respectively). It then iterates from 2 to `n`, updating `a` and `b` to hold the last two Fibonacci numbers in each iteration until it reaches `n`. Finally, it returns the value of `b`, which is the nth Fibonacci number.
